import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

console.log('Working just fine!');

const name = 'Kartik S';

const user = {
  firstName: 'Kartik',
  lastName: 'S'
};

function splitName(x) {
  return x.firstName + ' ' + x.lastName;
}

const element = <h1>Made by: {splitName(user)}</h1>;

class App extends Component {
  render(){
    return element;
  }
}

export default App;
